import React from 'react'
import Navbar from '../../components/Navbar'
import { useState, useEffect } from 'react'
import { useNavigate } from 'react-router-dom';
import CreateProjectModal from './CreateProjectModal';
import MiniProject from './MiniProject';

function UserProjects({user}) {
  let navigate = useNavigate()

  function handleDetailsClick() {
    navigate(`/ProjectDetails/${user.id}`)
  }

  const mappedProjects = user.projects?.map(proj => {
    <MiniProject key={proj.id} proj={proj} />
  })

console.log(user.projects);

  return (
    <div>
      <Navbar />
            <div class="input-group mb-5 justify-content-center">
              <div class="form-outline">
                <input placeholder='Search...' type="search" id="form1" class="form-control h-75" />
                <label class="form-label" for="form1"></label>
              </div>
              <CreateProjectModal />
           </div>
      <div class="container py-5 h-100 border">
    <div class="row d-flex justify-content-center align-items-center h-100">
      <div class="col col-xl-10 row ">
        {user.projects?.map(proj => {
          <MiniProject key={proj.id} proj={proj} user={user} />
          })}
      </div>
    </div>
  </div>
  </div>
  )
}

export default UserProjects
